import React from 'react'
import cl from './WeathercardMain.module.css'


const WeatherCardMain = () => {
  return (
    <div className={cl.main}>
      <div className={cl.main__radio}>
        <img src="./" alt="" />
      </div>
    </div>
  )
}

export default WeatherCardMain
